/**
 * @param {string[]} A
 * @return {number}
 */
var minDeletionSize = function(A) {
  let count = 0,
      length = A.length,
      innerL = A[0].length
  
  for (let i = 0; i < innerL; i++) {
      for (let j = 1; j < length; j++) {
          if (A[j][i] < A[j - 1][i]) {
              count++
              break
          }
      }
  }
  
  return count
};

